const Pokemon = ({name , life , strong , defense, speed , weight , height , img, types}) => {
    
    console.log(types);
    console.log(life)

    return (
        <div>
            <br />
            nombre : {name}
            <br />
            Tipo : {types.map()}
            <br />
            <img src={img} alt="pokemon" />
            <br />
        </div>
    )
}

export default Pokemon
